import { Plus } from "react-bootstrap-icons";
import { Link, Route, Switch } from "react-router-dom";
function Home({ decks }) {
  let deckRend = decks.map((deck) => (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">{deck.name}</h5>
        <p className="card-text">{deck.description}</p>
        <Link className="btn btn-primary">View</Link>
        <Link className="btn btn-primary">Study</Link>
        <Link className="btn btn-primary">Delete</Link>
      </div>
    </div>
  ));
  return (
    <>
      <Link to="/decks/new" className="btn btn-secondary text-white">
        <Plus /> Create Deck
      </Link>
      {deckRend}
    </>
  );
}

export default Home;
